import React from 'react';
import { useNavigate } from 'react-router-dom';

const OwnerDashboard = () => {
    const user = JSON.parse(localStorage.getItem('user')); // Get the user from localStorage
    const navigate = useNavigate();

    // Handle logout
    const handleLogout = () => {
        localStorage.removeItem('token'); // Remove token
        localStorage.removeItem('user');  // Remove user data
        navigate('/login'); // Redirect to login page
    };

    return (
        <div className="bg-gray-100 py-10 min-h-screen text-center">
            <h1 className="text-4xl text-customGreen font-bold mb-6">Welcome, {user?.firstName}!</h1>
            <p className="text-lg text-gray-600 mb-6">You are logged in as an Owner.</p>
            {/* Owner-specific content */}
            <div className="bg-white p-6 shadow-md rounded-lg">
                <h2 className="text-2xl font-bold mb-4">Owner Dashboard</h2>
                <p className="text-gray-600 mb-4">Here is some owner-specific information.</p>
                <button onClick={handleLogout} className="bg-red-500 text-white py-2 px-4 rounded-lg">Logout</button>
            </div>
        </div>
    );
};

export default OwnerDashboard;
